from typing import List
import uuid
import os

saved = os.path.join(os.path.dirname(__file__), "saved")
weka =  os.path.join(os.path.dirname(__file__), "weka.jar")

class Recogniser:

    def __init__(self, features: List[str]):
        self.session = uuid.uuid4()
        self.features = features
        self.models = {}

        types = {}
        with open(f"{saved}/_meta", "r") as f:
            for line in f:
                (k, v) = line.strip().split('_')
                types[k] = v

        for trait in types:
            self.models[trait] = Model(name=self.session, trait=trait, classifier_type=types[trait], classpath=weka)
            self.models[trait].load_model(f"{saved}/{trait}.model")
            self.models[trait].feat = features

    def personalise(self, X):

        y = {_id : {"o": 0, "c": 0, "e": 0, "a": 0, "n": 0} for _id in X}

        for trait in self.models:
            self.models[trait].set_samples(X)

            try:
                preds = self.models[trait].predict()
            except Exception as e:
                if hasattr(e, 'message'):
                    print(f"Personality recognition error: {e.message}")
                else:
                    print(f"Personality recognition error: {e}")
                return False

            for p in preds:
                y[p][trait] = preds[p]

        clear(self.session)

        return y

